import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import { GameBoard } from "./components";

class App extends Component {
  state = {
    puzzle: [],
    columns: [],
    counter: 0
  };

  componentWillMount() {
    this.getPuzzle();
  }

  getPuzzle() {
    fetch("http://localhost:3000/puzzles", {
      method: "GET",
      headers: {
        "Content-Type": "application/json"
      }
    })
      .then(response => response.json()) //
      .then(responseJson => {
        this.setState({
          puzzle: responseJson.puzzles[0]
        });

        console.log(this.state.puzzle);
      })
      .catch(error => {
        console.error(error);
      });
  }

  splitPuzzle() {
    const columns = [];
    for (let i = 0; i < 9; i++) {
      columns[i] = this.state.puzzle.puzzle[this.state.counter];
    }
    console.log(columns);
  }

  /*   renderGameBoard() {
    for (let j = 0; j < 9; j++) {
      for (let i = 0; i < this.state.board[j].length; i++) {
        return (
          <div>
            {console.log("hello")}
            {this.state.board[i].map(cell => (
              <Cell key={cell} />
            ))}
            ;
          </div>
        );
      }
    }
  } */

  render() {
    return (
      <div className="appView">
        <GameBoard />
      </div>
    );
  }
}

export default App;
